import React from 'react';
import {BrowserRouter as Router,Switch,Route, Link} from 'react-router-dom'
import about from './about'

function HomePage(props) {
    return (
        <div>
            <Router>
                <Link to='/about'>About</Link>
                <Switch>
                    <Route path='/about'>
                        <about />
                    </Route>
                </Switch>
            </Router>
        </div>
    );
}

export default HomePage;
